import React from "react";

import "./MainHeader.css";

const MainHeader = (props) => {
    return <header className="main-header">
        <h1>{props.title}</h1>
        <nav>
            <ul>
                {props.children}
            </ul>
        </nav>
    </header>;
};
export default MainHeader;
